window.bookSummaryJSON = "<p><b>Leveling up would be amazing...</b>&nbsp;</p> <p><b>... if it weren't so deadly.</b>&nbsp;</p> <p>They injected me with a VR chip, a GPS tracker, and my first Seed. They gave me unbelievable powers.</p> <p>Then they sent me to fight.</p> <p>The monsters here are alien and vicious. There is a second moon in the sky. I watched a <i>tree</i> start moving and kill someone. And the other Players...?&nbsp;</p> <p>They're even worse.&nbsp;</p> <p>I’m alone. I’m weak. And I’m scared. But I will cling to life by the tips of my bloody fingernails.&nbsp;</p> <p>Who is behind this twisted game? Where are they sending us? Is there anyone I can trust?&nbsp;</p> <p>If I want to survive, I have to get stronger. But can I do it before the Game kills me?</p> <p><i>Gods of Blood and Bone</i> is the first book in a dark and deliciously violent adventure series that combines science fiction, fantasy, and game elements. You'll love <i>Gods of Blood and Bone</i> because of the electrifying action, flawed characters, and kick-ass heroine.&nbsp;&nbsp;</p> <p><b>Buy </b><b><i>Gods of Blood and Bone</i></b><b> and start the series that will keep you up all night listening.</b></p>"; 
